import React from 'react';
import './ServicesPage.css';

const ServicesPage = ({ theme }) => {
  return (
    <div className={`services-page ${theme.toLowerCase()}`}>
      <h1 data-aos="fade-up">Our Services</h1>
      {theme === 'Mafia' && (
        <p data-aos="fade-left" className="mafia-theme">
          Protection and expansion for your business empire.
        </p>
      )}
      {theme === 'Drug Game' && (
        <p data-aos="fade-right" className="drug-game-theme">
          We provide the goods your operation needs.
        </p>
      )}
      {theme === 'Adult Entertainment' && (
        <p data-aos="fade-left" className="adult-theme">
          Keeping your audience entertained and coming back for more.
        </p>
      )}
      {theme === 'Monopoly' && (
        <p data-aos="fade-right" className="monopoly-theme">
          Helping you acquire every block on the board.
        </p>
      )}
      {theme === 'Foodie Influencer' && (
        <p data-aos="fade-left" className="foodie-theme">
          Serving up the best digital dishes to satisfy your business
          needs.
        </p>
      )}
      {theme === 'Social Media Influencer' && (
        <p data-aos="fade-right" className="social-influencer-theme">
          Let's make your brand trend.
        </p>
      )}
    </div>
  );
};

export default ServicesPage;
